import React from 'react';

const Picture = ({ pictures })=> {
 if (Object.keys(pictures).length && pictures.length){
  return(
   <div className="pictures-container">
    {pictures.map(picture=>{
      return(
        <div >
          <img src={picture.previewURL} alt=""/>
        </div>
     )
     })
    }
   </div>
  )
 }
}
export default Picture;
